import React from 'react';
import './assets/ex_libs/bootstrap_4/bootstrap.css'
import './assets/css/style.css';
import { Routes } from 'react-router-dom';
import Homepage from './Homepage';


const App = () => {
  <Routes>
    <Route path="/" exact element={<Homepage />}/>
  </Routes>
}

export default App;
